  //pick a word that comes next at the same frequency as the data set
  pickNextWord(tokenList, curWord) {
    const wordOptions = tokenList[curWord];
    const totalCount = Object.values(wordOptions).reduce( (acc, w) => acc + w );
    const value = Math.random() * totalCount;
    let curCount = 0;
    let keys = Object.keys(wordOptions);
    for (let i = 0; i < keys.length; i++) {
      curCount += wordOptions[keys[i]];
      if (curCount >= value) {
        return keys[i];
      }
    }
    return '?';
  }

  //build an entire movie name
  makeName(tokenList) {
    const wordList = [];
    //start with a start of title marker
    let lastWord = '^';
    const maxLength = 7;
    while (true) {
      const nextWord = this.pickNextWord(tokenList, lastWord);
      //stop if we hit an end of title marker
      if (nextWord === '$') {break;}
      wordList.push(nextWord);
      lastWord = nextWord;
      if (wordList.length > maxLength) {break;}
    }
    return wordList;
  }

  makeTitle() {
    const lowerCaseWords = {
      the: true,
      a: true,
      an: true,
      and: true,
      but: true,
      for: true,
      at: true,
      by: true,
      to: true,
      in: true,
      of: true
    };
    while (true) {
      const titleList = this.makeName(this.tokenList);
      if (titleList.length === 1) {continue;}
      //apply rough title capitalization
      const title = titleList.map((word, i) => {
        if (i !== 0 && i !== titleList.length - 1 && lowerCaseWords[word]) {
          return word;
        } else {
          return word.charAt(0).toUpperCase() + word.substr(1);
        }
      }).join` `;
      //skip if we just re-created something in the original list
      if (this.movieList.indexOf(title.toLowerCase()) === -1) {
        return title;
      }
    }
  }
  

  draw(ctx, width, height, t) {
    if (t < 0.2) {
      ctx.fillStyle = 'black';
      ctx.fillRect(0, 0, width, height);
    }
    //fade out
    ctx.fillStyle = 'hsla(0, 0%, 0%, 0.03)';
    ctx.fillRect(0, 0, width, height);
    ctx.font = '30px Grandstander';
    ctx.fillStyle = `hsl(0, 100%, 70%)`;
    ctx.textAlign = 'center';
    if (t > this.nextTime) {
      ctx.translate(width / 2, height / 2);
      //skip titles that are too large to display
      while (true) {
        const title = this.makeTitle();
        const textSize = ctx.measureText(title).width;
        if (textSize < width * 0.9) {
          const textX = this.lmap(Math.random(), 0, 1, -width / 2 + 20 + textSize / 2, width / 2 - 20 - textSize / 2);
          const textY = this.lmap(Math.random(), 0, 1, 200, -200);
          ctx.fillText(title, textX, textY);
          break;
        }
      }
      this.nextTime = t + 1 + 2 * Math.random();
    }

  }
